import React, { useEffect, useState, useRef } from "react";
import "../style/login.css";
import { Link } from "react-router-dom";
import axios from "axios";
import {
  Avatar,
  Button,
  CssBaseline,
  TextField,
  FormControlLabel,
  Checkbox,
  Grid,
  Box,
  LockOutlinedIcon,
  Typography,
  Container,
  createTheme,
  ThemeProvider
} from "@mui/material";

const Signup = () => {
  const [user, setUser] = useState({});

  const fetchAxios = async () => {
    const data = await axios.post("http://localhost:3001/users", user);
    console.log(data);
  };

  // useEffect(() => {
  //   fetchAxios();
  // }, []);

  const handleSubmit = () => {
      fetchAxios();
  };


  
  return (
        <div>
          <input onChange={(e) => setUser(e.target.value)} type="text" placeholder="name"/>
          <input onChange={(e) => setUser(e.target.value)} type="email" placeholder="email"/>
          <input onChange={(e) => setUser(e.target.value)} type="password" placeholder="password"/>
          <button onClick={handleSubmit} className="submit">
                 Submit
              </button>
          already have an acount? <Link to="/login">Login</Link>
        </div>
  );
};
export default Signup;
